import React from 'react';

const Raffle = () => {
return (
	<div
	style={{
		display: 'flex',
		justifyContent: 'Right',
		alignItems: 'Right',
		height: '100vh'
	}}
	>
	<h1>Raffle</h1>
	</div>
);
};

export default Raffle;
